import { NavBar, NoteUICollection, CreateNote } from './ui-components'

function App() {
  return (
  <>
    <NavBar marginBotton='20px' />
    <div className='container'>
      <NoteUICollection/>
    </div>
    <div className='modal'>
      <CreateNote/>
    </div>
  </>
  );
}

export default App;
